define('text!views/ticketcreate.html',[],function () { return '<section id="session-view" class="view">\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n    <div class="button-bar btn-block">\r\n        <button class="btn btn-info"\r\n            data-bind="click: goBack">\r\n            <i class="icon-hand-left"></i> Back</button>\r\n        <button class="btn btn-info"\r\n            data-bind="click: cancel, enable: canSave">\r\n            <i class="icon-undo"></i> Cancel</button>\r\n        <button class="btn btn-info"\r\n            data-bind="click: save, enable: canSave">\r\n            <i class="icon-save"></i> Save</button>\r\n        <i class="icon-asterisk" data-bind="visible: hasChanges"></i>\r\n    </div>\r\n    <section data-bind="with: ticket">\r\n        <div class="form-horizontal">\r\n            <div class="row">\r\n                <div class="span12">\r\n                    <div class="control-group">\r\n                        <label class="control-label" for="title">Title</label>\r\n                        <div class="controls">\r\n                            <input type="text" class="input-xxlarge" id="title" data-bind="value: title"\r\n                                placeholder="Ticket title" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div class="row">\r\n                <div class="span4">\r\n                    <div class="control-group">\r\n                        <label class="control-label" for="category">Category</label>\r\n                        <div class="controls">\r\n                            <select id="category" class="input-medium" data-bind="options: $parent.categoryList, optionsText: \'value\',\r\n    optionsValue: \'value\', value: category, optionsCaption: \'--select--\'">\r\n                            </select>\r\n                        </div>\r\n\r\n                    </div>\r\n                </div>\r\n                <div class="span4">\r\n                    <div class="control-group">\r\n                        <label class="control-label" for="ticketType">Type</label>\r\n                        <div class="controls">\r\n                            <select id="ticketType" class="input-medium" data-bind="options: $parent.ticketTypeList, optionsText: \'value\',\r\n    optionsValue: \'value\', value: ticketType, optionsCaption: \'--select--\'">\r\n                            </select>\r\n                        </div>\r\n\r\n                    </div>\r\n\r\n                </div>\r\n                <div class="span4">\r\n                    <div class="control-group">\r\n                        <label class="control-label" for="priority">Priority</label>\r\n                        <div class="controls">\r\n                            <select id="priority" class="input-medium" data-bind="options: $parent.priorityList, optionsText: \'value\',\r\n    optionsValue: \'value\', value: priority, optionsCaption: \'--select--\'">\r\n                            </select>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div class="row">\r\n                <div class="span6">\r\n                    <div class="control-group">\r\n                        <label class="control-label" for="tagList">Tags</label>\r\n                        <div class="controls">\r\n                            <input type="text" class="input-xlarge" id="tagList" data-bind="value: tagListFormatted" placeholder="tag1,tag2" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class="span6">\r\n                <div class="control-group">\r\n                    <div class="controls">\r\n                        <label class="checkbox" for="affectsCustomer">\r\n                            <input type="checkbox" id="affectsCustomer" data-bind="checked: affectsCustomer" />Affects Customer</label>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div class="row">\r\n                <div class="span12">\r\n                    <div class="control-group"  style="width: 100%;">\r\n                        <label class="control-label" for="wmd-input-ticketDetails">Details</label>\r\n                        <div class="wmd-panel controls">\r\n                            <div class="tabbable tabs-below">\r\n                                <div class="tab-content">\r\n                                    <div id="wmd-button-bar-ticketDetails"></div>\r\n                                    <div class="tab-pane" id="tab2">\r\n                                        <div id="wmd-preview-ticketDetails" class="wmd-panel wmd-preview well"></div>\r\n                                    </div>\r\n                                    <div class="tab-pane active" id="tab1">\r\n                                        <textarea class="wmd-input" id="wmd-input-ticketDetails" name="ticketDetails" rows="10" data-bind="value: details"></textarea>\r\n                                    </div>\r\n                                </div>\r\n                                <ul class="nav nav-tabs pull-right">\r\n                                    <li class="active"><a href="#tab1" data-toggle="tab">Compose</a></li>\r\n                                    <li><a href="#tab2" data-toggle="tab">Preview</a></li>\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div class="row">\r\n                <div class="span4">\r\n                    <div class="control-group">\r\n                        <label class="control-label" for="owner">Owner</label>\r\n                        <div class="controls">\r\n                            <input type="text" id="owner" data-bind="value: owner" placeholder="person name" />\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class="span4">\r\n                    <div class="control-group">\r\n                        <label class="control-label" for="assignedTo">Assigned To</label>\r\n                        <div class="controls">\r\n                            <input type="text" id="assignedTo" data-bind="value: assignedTo"\r\n                                placeholder="person name" />\r\n\r\n                        </div>\r\n                    </div>\r\n\r\n                </div>\r\n            </div>\r\n    </section>\r\n</section>\r\n\r\n<!--           \r\n            \r\n\r\n          \r\n\r\n\r\n\r\n\r\n\r\n    \r\n\r\n\r\n        </div>-->\r\n';});

